import React from 'react';
import './Footer.css';

function Footer() {
  return (
    <footer className="footer">
      <p>&copy; 2024 Top Software. All rights reserved.</p>
      <p>
        Follow us: <a href="https://linkedin.com">LinkedIn</a> | <a href="https://twitter.com">Twitter</a>
      </p>
    </footer>
  );
}

export default Footer;
